export function getProperty(e,n){var t=e[n];if(t instanceof TimeRanges){for(var r=new Array,s=0;s<t.length;s++)r.push({start:t.start(s),end:t.end(s)});t=r}return t}export function setProperty(e,n,t){e[n]=t}export function invokeFunction(e,n,...t){return e[n](...t)}const _listeners=[];export function subscribeToEvent(e,n,t){var r=function(){n.invokeMethodAsync("EventFired",t)};e.addEventListener(t,r),_listeners.push({elm:e,eventName:t,listener:r})}export function dropAllEventListeners(e){for(var n=_listeners.length-1;n>=0;n--){var t=_listeners[n];t.elm==e&&(e.removeEventListener(t.eventName,t.listener),_listeners.splice(n,1))}}